AnalogValue advanced_key_normalize(AdvancedKey* advanced_key, AnalogRawValue value)
{

const uint16_t length = sizeof(table) / sizeof(table[0]);
#ifndef FIXED_POINT_EXPERIMENTAL
#ifdef OPTIMIZE_FOR_FLOAT_DIVISION
    float x = (advanced_key->config.upper_bound - value) * advanced_key->range_reciprocal;
#else
    float x = (advanced_key->config.upper_bound - value) / (float)(advanced_key->config.upper_bound - advanced_key->config.lower_bound);
#endif
    int16_t index = x * length;
#else
    int16_t index = (advanced_key->config.upper_bound - value) * length / (advanced_key->config.upper_bound - advanced_key->config.lower_bound);
#endif
    if (index < 0)
    {
        index = 0;
    }
    if (index >= length)
    {
        index = length - 1;
    }
    return table[index] + ANALOG_VALUE_MIN;
    /*
    if (x<0.225)
    {
        return x*(0.5/0.225);
    }
    else if (x<0.404)
    {
        return (x-0.225)*(0.25/(0.404-0.225))+0.5;
    }
    else
    {
        return (x-0.404)*(0.25/(1.0-0.404))+0.75;
    }
    */
    
}

void keyboard_delay(uint32_t ms)
{
    HAL_Delay(ms);
}

void keyboard_reboot()
{
    __set_FAULTMASK(1);
    NVIC_SystemReset();
}

#define SEL_MASK  (A_Pin | B_Pin | C_Pin | D_Pin)
void analog_channel_select(uint8_t x)
{
    //x=BCD_TO_GRAY(x);
    uint32_t set_mask = 0;

    if (x & 0x01) set_mask |= A_Pin;  // A
    if (x & 0x02) set_mask |= B_Pin;  // B
    if (x & 0x04) set_mask |= C_Pin;  // C
    if (x & 0x08) set_mask |= D_Pin;  // D

    uint32_t rst_mask = SEL_MASK & ~set_mask;

    LL_GPIO_SetOutputPin(INHIBIT_GPIO_Port, INHIBIT_Pin);
    A_GPIO_Port->BSRR = (set_mask) | (rst_mask << 16);
    LL_GPIO_ResetOutputPin(INHIBIT_GPIO_Port, INHIBIT_Pin);
}

void keyboard_jump_to_bootloader(void)
{
    void JumpToBootloader(void);
    JumpToBootloader();
}

void keyboard_user_event_handler(KeyboardEvent event)
{
    if (event.event != KEYBOARD_EVENT_KEY_DOWN)
    {
        return;
    }
    keyboard_key_event_down_callback((Key*)event.key);
    extern bool beep_switch;
    extern bool em_switch;
    switch (KEYCODE_GET_SUB(event.keycode))
    {
    case USER_BEEP:
        beep_switch = !beep_switch;
        break;
    case USER_EM:
        em_switch = !em_switch;
        break;
    case USER_SNAKE_LAUNCH:
        if (!low_latency_mode)
        {
            snake_launch(&g_snake);
        }
        break;
    case USER_SNAKE_QUIT:
        snake_quit(&g_snake);
        break;
    case USER_SNAKE_PAUSE:
        snake_pause(&g_snake);
        break;
    case USER_SNAKE_SPEED_UP:
        snake_speed_up(&g_snake);
        break;
    case USER_SNAKE_SPEED_DOWN:
        snake_speed_down(&g_snake);
        break;
    case USER_SNAKE_RESTART:
        snake_restart(&g_snake);
        break;
    case USER_SNAKE_LEFT:
    case USER_SNAKE_UP:
    case USER_SNAKE_RIGHT:
    case USER_SNAKE_DOWN:
        snake_turn(&g_snake, KEYCODE_GET_SUB(event.keycode)&0x07);
        break;
    case USER_TOGGLE_LOW_LATENCY_MODE:
        low_latency_mode = !low_latency_mode;
        break;
    default:
        beep_switch = false;
        em_switch = false;
        low_latency_mode = false;
        g_keyboard_config.debug = false;
        g_keyboard_config.winlock = false;
        g_keyboard_config.nkro = true;
        break;
    }
}

